	          "type": "code",
	          "code": "export default {\n  component: 'div',\n  childRoutes: [ {\n    path: '/',\n    component: require('./components/App'),\n    childRoutes: [\n      require('./routes/Calendar'),\n      require('./routes/Course'),\n      require('./routes/Grades'),\n      require('./routes/Messages'),\n      require('./routes/Profile')\n    ]\n  } ]\n}",
